import React, {Component} from 'react';
import Modal from '../Modal/Modal';
const slugify = required("slugify");

class FormList extends Component {

    componentDidMount() {
        let testObject = {
            id:Math.random(),
            "name": "Test form",
            "description": "Uye bilgi formu",
            createdAt: "2017-01-08",
            fields: [ 
                { "required": true, "name": "Ad", dataType: "STRING" }, 
                { "required": true, "name": "Soyad", dataType: "STRING" },
                { "required": false, "name": "Yaş", dataType: "NUMBER" } 
            ]
        }

        localStorage.setItem("form_list",JSON.stringify([testObject,testObject]));
        console.log(localStorage)
        console.log(localStorage.getItem("form_list"))
    }


    render() {
        return (
            <React.Fragment>
                <h1>Form List</h1>
                <Modal></Modal>
            </React.Fragment>
        )
    }

}

export default FormList;
